            function getOS() {
                var ua = navigator.userAgent;
                var uaindex;

                // determine OS
                if (ua.match(/iPad/i) || ua.match(/iPhone/i)) {
                    userOS = 'iOS';
                    uaindex = ua.indexOf('OS ');
                }
                else {
                    userOS = 'unknown';
                }

                // determine version
                if (userOS === 'iOS') {
                    $("#webcontent_0_ibframe").css("display", "none");
                    $('#embedIB').css("display", "inline");
                }
                else {
                    $("#webcontent_0_ibframe").css("display", "block");
                    $('#embedIB').css("display", "none");
                    var $form = $("#webcontent_0_ibframe").closest('form');
                    $form.height("100%");
                    var locationControl = '#' + 'webcontent_0_locationAnchor';
                    var locationAnchor = $(locationControl).text();
